import React from "react";
import ReactDOM from "react-dom";
//import image from "../public/asset/kobeBryant.jpg";

class Cell extends React.Component {

    constructor(props) {
        super(props);
        props = this.props
    }



    componentDidMount() {
        let current = ReactDOM.findDOMNode(this);
        let button = current.querySelector(".upVote");
    }


    render() {
        return (
            <tr className="row">
                <th>{props.rank}</th>
                <th>
                    <div className="image_border">
                        <img src={props.image} className="profile_pic" alt="" >
                        </img>
                        <div className="medal"></div>
                    </div></th>
                <th><div className="name">{props.name}</div></th>
                <th>
                    <a className="upVote">
                        <img src="/asset/vote_btn.svg"></img>
                    </a>
                </th>
                <th className="count">{props.count}</th>
            </tr>
        );
    }
}

export default Cell;
